import React from 'react';

function AccountInformation(props) {
    return (
        <div className="accountInformation">
            <div className="information">
                <div className="date">
                    Date create {props.card.dateCreated}
                </div>
                <div className="Money">
                    Money left {props.card.money}
                </div>
            </div>
            <div className="buttons">
                <input type="button" value="Історія" className="btn linkButton" />
                <input type="button" value="Зробити переказ" className="btn linkButton" />
            </div>
        </div>
    );
}

export default AccountInformation;
